import axios from './axiosConfig';

// Ejemplo de uso de Axios para hacer una solicitud G
const getPlates = () =>{
  axios.get('/https://api.spoonacular.com/recipes/complexSearch?apiKey=ed087624ad1a490ca68b709efcbd6c02')
  .then((response) => {
    console.log('Respuesta exitosa:', response.data);
  })
  .catch((error) => {
    console.error('Error:', error);
  });
}

const getInfoPlate = (id) =>{
  axios.get(`https://api.spoonacular.com/recipes/${id}/information?apiKey=ed087624ad1a490ca68b709efcbd6c02`)
  .then((response) => {
    console.log('Respuesta exitosa:', response.data);
  })
  .catch((error) => {
    console.error('Error:', error);
  });
}
